import React ,{useState} from 'react';
import './App.css';
import Nav from './components/Nav.jsx'
import Landingpage from './components/landingpage.jsx'
import Parallax from './components/parallax.jsx'
import Parallax2 from './components/parallax2.jsx'
import af1 from './images/Nike-x-Carhartt-WIP-Air-Force-1-Low-_57.jpg'
import af2 from './images/maksim-larin-Ai356rggKvw-unsplash.jpg';
import gold from './images/whereslugo-6QvRVC-6_Vo-unsplash.jpg'
import gold1 from './images/Cheap-Nike-SF-AF1-Mid-Lunar-New-Year-White-For-Sale-5.jpeg'



function App() {

  const [State1] = useState([
    {key:"",
    img:af1,
    img1:af2,
    text1:"# AF-1",
    text2:"Carhartt WIP",
    heading:"About M",
    paragraph1:"Lorem ipsum dolor sit amet, consectetur adipisicing elit. Optio odio quisquam rerum velit, impedit inventore aliquam culpa cupiditate laborum quia dolor recusandae sapiente quasi, incidunt cum temporibus quas voluptates ullam debitis praesentium deleniti animi mollitia. Repellendus laboriosam nulla velit numquam? Aliquid aliquam tempore eveniet tempora molestias excepturi quia eos illum?",

}
  ]);

  const [State2] = useState([
    {key:"",
    img:gold,
    img1:gold1,
    text1:"# SF-AF1",
    text2:'"Lunar New Year"',
    heading:"About ",
    paragraph1:"Lorem ipsum dolor sit amet, consectetur adipisicing elit. Optio odio quisquam rerum velit, impedit inventore aliquam culpa cupiditate laborum quia dolor recusandae sapiente quasi, incidunt cum temporibus quas voluptates ullam debitis praesentium deleniti animi mollitia. Repellendus laboriosam nulla velit numquam? Aliquid aliquam tempore eveniet tempora molestias excepturi quia eos illum?",

}
  ]);

  const [State3] = useState([
    {key:"",
    img:af1,
    img1:af1,
    text1:"g",
    text2:"h",
    heading:"Abou",
    paragraph1:"Lorem ipsum dolor sit amet, consectetur adipisicing elit. Optio odio quisquam rerum velit, impedit inventore aliquam culpa cupiditate laborum quia dolor recusandae sapiente quasi, incidunt cum temporibus quas voluptates ullam debitis praesentium deleniti animi mollitia. Repellendus laboriosam nulla velit numquam? Aliquid aliquam tempore eveniet tempora molestias excepturi quia eos illum?",

}
  ]);

  return (
    <div className="App" >

      <Landingpage/>

      {State2.map((data, index) => (
            <Parallax2 
            key={index} 
            color="#293746" 
            Hcolor="#e8c530" 
            Tcolor="#f4f8ff" 
            img={data.img} 
            img1={data.img1} 
            text1={data.text1} 
            T1="red" 
            text2={data.text2} 
            T2="#f4f8ff" 
            heading={data.heading} 
            paragraph1={data.paragraph1} 
            />))}

      <Parallax/>

      {State1.map((data, index) => (
            <Parallax2
             key={index} 
             color="#8b5729" 
             Hcolor="#8b5729"
             Tcolor="#f4f8ff"
             img={data.img} 
             img1={data.img1} 
             text1={data.text1} 
             T1="#f4f8ff" 
             text2={data.text2} 
             T2="#f4f8ff" 
             heading={data.heading} 
             paragraph1={data.paragraph1}
              />))}

      <Parallax/>

      {State3.map((data, index) => (
            <Parallax2
             key={index} 
             color="red" 
             Hcolor="#8b5729" 
             Tcolor="#f4f8ff" 
             img={data.img} 
             img1={data.img1} 
             text1={data.text1} 
             T1="#f4f8ff" 
             text2={data.text2} 
             T2="#f4f8ff" 
             heading={data.heading} 
             paragraph1={data.paragraph1}
              />))}

    </div>
  );
}

export default App;
